package com.meganlee;

import java.util.*;
import org.junit.*;

public class DistinctSubsequencesTest {
    DistinctSubsequences solution = new DistinctSubsequences();
    private int calculate(String s1, String s2) {
        int res = solution.numDistinct3(s1, s2);
        System.out.println(s1);
        System.out.println(s2);
        System.out.println(res + "\n");
        return res;
    }

    @Test
    public void test() {
        Assert.assertEquals(3, calculate("rabbbit", "rabbit"), 3);
        Assert.assertEquals(3, calculate("ccc", "c"), 3);
        Assert.assertEquals(
            10582116, 
            calculate(
                "aabdbaabeeadcbbdedacbbeecbabebaeeecaeabaedadcbdbcdaabebdadbbaeabdadeaabbabbecebbebcaddaacccebeaeedababedeacdeaaaeeaecbe",
                "bddabdcae"
            )
        );
        Assert.assertEquals(
            1456742400, 
            calculate(
                "",
                "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"
            )
        );
    }
}
